import React from 'react';

const BlogsCards = props => {
    return (
        <>



            <div className="row">
            {
                        !!props.infoportfolio &&
                        props.infoportfolio.map((elem, i) => {
                            return (
                                <Portfoliocard 
                                    portimg={elem.portimg}
                                    title={elem.title}
                                    body={elem.body}
                                />
                            )
                        })

                    }


            </div>
        </>
    )
}

export default BlogsCards;
